function PropiedadHome(){
    return(
        <div className="contenedor-Propiedad-Home">
            <img 
            className="imagen-Propiedad"
            src={require("")}
            alt=""/>
            <div className="texto-Propiedad">
                <h4 className="titulo-Propiedad">A</h4>
                <p className="direccion-Propiedad">A
                </p>
            </div>
        </div>
    );
}
